import axios from "axios";


const HTML_API_URL="http://localhost:9090/getHtml";
const CSS_API_URL="http://localhost:9090/getCss";
const VANILA_API_URL="http://localhost:9090/getVanila";
const REACT_API_URL="http://localhost:9090/getReact";
const NODE_API_URL="http://localhost:9090/getNode";
const EXPRESS_API_URL="http://localhost:9090/getExpress";
const REACTNATIVE_API_URL="http://localhost:9090/getReactNative";
const COREJAVA_API_URL="http://localhost:9090/getCoreJava";
const ADVJAVA_API_URL="http://localhost:9090/getAdvJava";
const SERVLET_API_URL="http://localhost:9090/getServlet";
const SPRING_API_URL="http://localhost:9090/getSpring";
const SPRINGBOOT_API_URL="http://localhost:9090/getSpringBoot";
const HIBERNATE_API_URL="http://localhost:9090/getHibernate";
const ANDROID_API_URL="http://localhost:9090/getAndroid";
const PYTHON_API_URL="http://localhost:9090/getPython";
const C_API_URL="http://localhost:9090/getC";
const CPP_API_URL="http://localhost:9090/getCpp";
const SQL_API_URL="http://localhost:9090/getSql";

class Service{
    getHtml(){
        return axios.get(HTML_API_URL);
    }
    getCss(){
        return axios.get(CSS_API_URL);
    }
    getVanila(){
        return axios.get(VANILA_API_URL);
    }
    getReact(){
        return axios.get(REACT_API_URL);
    }
    getNode(){
        return axios.get(NODE_API_URL);
    }
    getExpress(){
        return axios.get(EXPRESS_API_URL);
    }
    getReactNative(){
        return axios.get(REACTNATIVE_API_URL);
    }
    getCoreJava(){
        return axios.get(COREJAVA_API_URL);
    }
    getAdvJava(){
        return axios.get(ADVJAVA_API_URL);
    }
    getServlet(){
        return axios.get(SERVLET_API_URL);
    }
    getSpring(){
        return axios.get(SPRING_API_URL);
    }
    getSpringBoot(){
        return axios.get(SPRINGBOOT_API_URL);
    }
    getHibernate(){
        return axios.get(HIBERNATE_API_URL);
    }
    getAndroid(){
        return axios.get(ANDROID_API_URL);
    }
    getPython(){
        return axios.get(PYTHON_API_URL);
    }
    getC(){
        return axios.get(C_API_URL);
    }
    getCpp(){
        return axios.get(CPP_API_URL);
    }
    getSql(){
        return axios.get(SQL_API_URL);
    }
}
export default new Service();
